import React, { useState, useEffect } from 'react';
import { Avatar, Button, message } from 'antd';
import { UserOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const AdministracionDeCuenta = () => {
  const navigate = useNavigate();
  const [userData, setUserData] = useState({});
  const [profileImage, setProfileImage] = useState(null);

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log(response);
        console.log("nombres" + response.data.registro.Nombres)
        // Suponiendo que la respuesta tiene una estructura { Foto_Perfil: 'nombre_imagen.jpg' }
      } catch (error) {
        console.error('Error al obtener la imagen del usuario:', error);
        // Manejar el error según tus necesidades
      }
    };

    obtenerImagenDeUsuario(); // Llamar a la función al montar el componente
  }, []);


  // Función para el botón de cierre de sesión
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  return (
    <div style={{ maxWidth: 600, margin: '0 auto', padding: '20px' }}>
      <h1>My Profile</h1>
      <Avatar size={100} src={profileImage} icon={<UserOutlined />} style={{ marginBottom: 16 }} />
      <p><strong>Name:</strong> {userData.Nombres}</p>
      <p><strong>Email:</strong> {userData.email}</p>
      <Button type="primary" onClick={handleLogout} style={{ marginRight: 16 }}>
        Cerrar Sesión
      </Button>
    </div>
  );
};

export default AdministracionDeCuenta;
